import React,{Component} from 'react'

class Signup extends Component
{
	constructor()
	{
		super()
		this.state={
			name:'',
			roll:'',
			mail:'',
			branch:'',
		}
	}
	nameChange=(event)=>{
		this.setState({
			name:event.target.value
		})
	}
	rollChange=(event)=>{
		this.setState(
		{
			roll:event.target.value
		})
	}
	render()
	{
		return (
			<div>
			<h1>Signup</h1>
			<form>
				Name : <input type="text" value={this.state.name} onChange={this.nameChange}/><br/>
				Roll no. :<input type="number" value={this.state.roll} onChange={this.rollChange}/><br/>
				Email :<input type="email" value={this.state.mail} onChange={this.mailChange}/><br/>
				<select value={this.state.branch}>
					<option>CSE</option>
					<option>ME</option>
					<option>CE</option>
					<option>EE</option>
					<option>ECE</option>
				</select><br/>
				<button type="Submit">Submit</button>
			</form>

		</div>
			)

	}
}
export default Signup
